import PropTypes from "prop-types";

const AppLayout = ({ Children }) => {
  return (
    <div>
      <div>공통 메뉴</div>
      {Children}
    </div>
  );
};

AppLayout.propTypes = {
  Children: PropTypes.node.isRequired,
};

export default AppLayout;
